import { TransactionHistory } from "./TransactionHistory";
import css from './TransactionHistory.module.css';


export const FriendListItems = ({ items }) => {
    return (
        <tbody>
            {items.map(item =>
                <tr key={item.id}>
                    <TransactionHistory item={item} />
                </tr>)}
        </tbody>
    );
};
